const block0 = (context, tags, suffix) => html`<div class="ui5-block-layer" ?hidden=${context._blockLayerHidden} tabindex="1" style="${styleMap(context.styles.blockLayer)}" @keydown="${context._preventBlockLayerFocus}" @mousedown="${context._preventBlockLayerFocus}"></div>`;


